msg = ''

msg2 = ''
for i in range(0,len(msg),2):
	t = int(msg[i:i+2], 16)
	msg2 += chr(t)


msg3 = ''
for i in range(0,len(msg2),2):
	t = int(msg2[i:i+2], 16)
	msg3 += chr(t)

msg4 = ''
for s in msg3.split(' '):
	t = int(s, 8)
	msg4 += chr(t)

print(msg4)

msg5 = ''
index = 0
for s in msg4.split(' '):
    if index > 0:
        if index % 3 == 0:
            t = int(s, 8)
        else:
            t = int(s, 16)
    msg5 += chr(t)
    index += 1

print(msg5)
